v8:item.v8:content:
* - представляется, начиная с первого квартала фактического исполнения Контракта
** -  гр. 10-11 заполняются нарастающим итогом с начала исполнения Контракта;
*** -данные указываются на дату составления Кассового плана на очередной квартал;
**** -при условии отражения в кассовом плане на очередной квартал планируемых расходов на расчеты с кооперацией одновременно с кассовым планом на очередной квартал представляются сведения о фактически заключенных с кооперацией контрактах (договорах) с указанием наименования исполнителей, реквизитов контрактов, цены, срока исполнения, сумм и сроков планируемых к выплате авансовых платежей;
***** - в сумме, не превышающей объемы авансирования, предусмотренные уведомлением Заказчика по госконтракту на текущий финансовый год; 
****** - строка 6 заполняется головным исполнителем с учетом технологического цикла и этапности производства на основе реальной оценки производственных возможностей, потребности в финансовых средствах кооперации на выполнение производственной программы, данных об остатке денежных средств на отдельном счете в уполномоченном банке у головного исполнителя.

